import channelTable from "@/components/channelTable";
import { postChannelStatisticsWatch } from "@/api/orderList";

export default {
  components: {
    channelTable
  },
  data() {
    return {
      list: []
    };
  },
  created() {
    this.getChannelStatistics();
  },
  methods: {
    getChannelStatistics() {
      const contains = false;
      const rows = 1000;
      const page = 1;
      postChannelStatisticsWatch({
        contains: contains,
        rows: rows,
        page: page
      }).then(res => {
        const dataList = res.data.rows;
        dataList.forEach(dataItem => {
          const { cpName, pNum } = dataItem;
          const listItem = { channel: cpName, orderCount: pNum };
          this.list.push(dataItem);
        });
        console.log(this.list)
      });
    }
  }
};
